import React from "react";
import impressionIcon from "../images/impressionIcon.png";
import styles from "./TrendingQuizBox.module.css";

function TrendingQuizBox({ quizName, impressions, createdAt }) {
  return (
    <div
     className={styles}
    >
      <div
        style={{
          display: "flex",
          paddingTop: "1.2vh",
          paddingLeft: "0.5vw",
          justifyContent: "space-between",
          alignItems: "center",
          paddingRight: "0.2vw",
        }}
      >
        <p
          style={{
            fontSize: "1.3em",
            whiteSpace: "nowrap",
            overflow: "hidden",
            textOverflow: "ellipsis",
          }}
        >
          {quizName}
        </p>
        <p style={{ color: "#FF5D01" }}>
          {impressions}
          <img
            style={{ height: "2.5vh", width: "1.3vw" }}
            src={impressionIcon}
            alt="impressionIcon"
          />
        </p>
      </div>

      <p
        style={{
          color: "#60B84B",
          fontSize: "1em",
          marginTop: "1.5vh",
          paddingLeft: "0.5vw",
        }}
      >
        Created on : {createdAt}
      </p>
    </div>
  );
}

export default TrendingQuizBox;
